import React from 'react'
import './login.css'

export default function login() {
  return (
    <div className='loginPage'>
        <input className='inputBox' type='text' placeholder='Enter Username or Email'/><br></br>
        <input className='inputBox' type='text' placeholder='Enter Password'/><br></br>
        <button className='loginButton' type='button'>Log in</button>
    </div>
  )
}
